// src/pages/Rifles.jsx
import useArmouryData from "../hooks/useArmouryData";

export default function Rifles() {
  const rifles = useArmouryData("rifles");
  return (
    <div className="p-10">
      <h2 className="text-2xl mb-6">Armoury: Rifles</h2>
      <ul>
        {rifles.map((rifle, idx) => (
          <li key={idx} className="mb-4 bg-gray-200 p-4 rounded shadow">
            <span className="text-xl font-semibold">{rifle.name}</span> <span className="ml-4 text-gray-700">Caliber: {rifle.caliber}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}
